import React from 'react';

const Navbar = props =>(
    <header className="toolbar">
        <nav className="navigation_bar">
            <div className="spacer" />
            <div className="navigation_items">
            <a href='/Login'><button>Login</button></a>
            </div>
    
        </nav>
    </header>
)

export default Navbar;
